import React from 'react';




function ButtonBar (props) {
    console.log(props)

    const increment = () => props.setCount(props.count + 1);

    function decrement() {
        if (props.count > 0){
            props.setCount(props.count - 1);
        } else {
            props.setCount(0)
        }
    }

    return (
        <div>
            <div>
            <button onClick={decrement}>-</button>
            <input type="text" value={props.count} onChange={e => props.setCount(e.target.value)}></input>
            <button onClick={increment.bind(this)}>+</button>
            </div>
        </div>

    )

}
export default ButtonBar;
